import { CCol, CRow } from "@coreui/react";
import { Form } from "react-bootstrap";
import CButton from "src/Components/UI/Button/Button";
import Card from "src/Components/UI/Card/Card";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
const PersonalInfo = (props) => {
  const data = props.body;
  console.log(data);
  return (
    <Card color="primary" header="Personal Information">
      <Form>
        <CRow>
          <FormInputLabel
            label="First Name"
            type="text"
            readOnly={false}
            md={6}
            sm={12}
          />
          <FormInputLabel
            label="Last Name"
            type="text"
            readOnly={false}
            md={6}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="Email"
            type="email"
            readOnly={true}
            md={7}
            sm={12}
          />
          <FormInputLabel
            label="Phone Number"
            type="text"
            readOnly={false}
            md={5}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="User Name"
            type="text"
            readOnly={true}
            md={6}
            sm={12}
          />
          <FormInputLabel
            label="User Role"
            type="text"
            readOnly={true}
            md={6}
            sm={12}
          />
        </CRow>
        <CRow>
          <FormInputLabel
            label="Created At"
            type="text"
            readOnly={true}
            md={6}
            sm={12}
          />
        </CRow>
        <CRow >
          <CCol md={12} sm={12}>
            <CButton
              color="success"
              width="30%"
              type="submit"
              loading={false}
              name="update"
            />
          </CCol>
        </CRow>
      </Form>
    </Card>
  );
};
export default PersonalInfo;
